                    {
                        Header: "First Name",
                        accessor: "album"
                    },
                    {
                        Header: "Last Name",
                        accessor: "lastName"
                    }
                    ]
                },
                {
                    Header: "Info",
                    columns: [
                    {
                        Header: "Age",
                        accessor: "age"
